import React, { Component } from 'react'
import { Row } from 'react-bootstrap';
import axios from 'axios';

//Planten Pagina
export class Planten extends Component {
    constructor(props) {
        super(props);
      }
    
      state = {
        plants: {}
     }

     stations = [
        {call:'station one',frequency:'000'},
        {call:'station two',frequency:'001'}
      ]

    getPlants = async () => {
        try {
          return await axios.get('https://europe-west1-smartbroeikas.cloudfunctions.net/api/getplants')
        } catch (error) {
          console.error(error)
        }
    }

    logPlants = async () => {
        const plants = this.getPlants()
          .then(response => {
            if (response.data) {
                this.setState({
                    plants: response
                })
            }
          })
          .catch(error => {
            console.log(error)
          })
      }
      
      componentWillMount() {
        this.logPlants()
      }

    render() {
        console.log(this.state.plants.data);
        const Test = ({stations}) => (
            <>
              {stations.map(station => (
                <div className="station" key={station.call}>{station.call}</div>
              ))}
            </>
          ); 

        return ( 
            <div>
                <h2>Planten</h2>
                {/* {Object.keys(this.state.plants.data).map((keyName, i) => {
                    console.log('test');
                    return <Row>
                                <div className="col">key: {i} Name: {this.state.plants[keyName].data} </div>
                            </Row>
                })} */}
                <div>
                    <Test stations={stations} />
                </div>

                <Row>
                    <div className="col">test</div>
                    <div className="col">dfd</div> 
                </Row>
            </div>
        )
    }
}

export default Planten
